create database Safety_route;
use Safety_route;
create table Safety_route.CCTV (
id INTEGER,
지역 VARCHAR(30),
도로명주소 VARCHAR(50),
지번주소 VARCHAR(100),
설치목적 VARCHAR(20),
갯수 INTEGER,
화소수 INTEGER,
촬영방면 VARCHAR(20),
보관일수 INTEGER,
설치날짜 VARCHAR(20),
전화번호 VARCHAR(20),
위도 DOUBLE,
경도 DOUBLE,
업데이트날짜 VARCHAR(20),
primary key (id)
);
